import { 
    FORMULARIO_EQUIPO,
    OBTENER_EQUIPOS
} from '../../types';

/*
const fn = (state, action) => {
    switch(action.type) {
        case FORMULARIO_EQUIPO:
            return {
                ...state,
                formulario: true
            }
        case OBTENER_EQUIPOS:
            return {
                ...state,
                proyectos: action.payload
            }
        default:
            return state;
    }
}
export default fn;

*/

export default (state, action) => {
    switch(action.type) {
        case FORMULARIO_EQUIPO:
            return {
                ...state,
                formulario: true
            }
        default:
            return state;
    }
}
